import React from 'react';
import {BodyHomeBody,BodyP,BodyDiv} from './ContactElements';
const Contact = () => {
    return (
        <>
            <BodyHomeBody>
                <BodyDiv>
                    <ImageLogo>
                        <img src={logo} />
                    </ImageLogo>
                    <BodyP>07 49 83 87 49</BodyP>
                    <BodyP>https://www.facebook.com/giuseppe.pizza38270/</BodyP>
                giuseppe.pizza38270
                <BodyP>https://www.instagram.com/giuseppe.38270/</BodyP>
                @giuseppe.38270
                giuseppe38270@gmail.com
            </BodyDiv>
            </BodyHomeBody>
        </>
    );
}

export default Contact;
